// React libs
import React from 'react';
import { BrowserRouter, Routes, Route, Outlet, useLocation, Navigate, } from "react-router-dom";
// Components
import NavBar from "./components/NavBar"
import FooterComponent from './components/FooterComponent';
// Pages
import Home from "./pages/Home";
import NoPage from "./pages/NoPage"
import LogIn from './pages/LogIn';
import TermsAndConditions from './pages/TermsAndConditions';
import AboutUs from './pages/AboutUs';
import Dashboard from './pages/Dashboard';
import Settings from './pages/Settings';
import SignUp from './pages/SignUp';
import BlitzBout from './pages/BlitzBout';
// Hooks
import useToken from './hooks/useToken';
import useAvatar from './hooks/useAvatar';
import useUsername from './hooks/useUsername';
import useEmail from './hooks/useEmail';

export default function App() {

  const { token, setToken } = useToken();
  const { avatar, setAvatar } = useAvatar();
  const { username, setUsername} = useUsername();
  const { email, setEmail} = useEmail();

  const SecureAccountRoutes = () => {

    const location = useLocation()

    if(!token) {
      if (location.pathname === "/account/sign-up" || location.pathname === "/account/log-in" ) {
        return (
          <Outlet/> 
        );
      }
      else {
        return (
          <Navigate to="/account/log-in" />
        );
      }
    }
    else if(token && (location.pathname === "/account/sign-up" || location.pathname === "/account/log-in")) {
      return (
        <Navigate to="/account/dashboard" />
      );
    }
    else {
      return (
        <Outlet/> 
      );
    }

  }

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element = {<><NavBar token = {token} avatar = {avatar} username = {username} email = {email}/><FooterComponent /></>}>

          <Route index element={<Home />} />
          <Route path = "Home" element={<Home />} />
          <Route path = "Terms-and-Conditions" element = {<TermsAndConditions />}/>
          <Route path = "About-Us" element = {<AboutUs />}/>

          <Route path = "account/" element = {<SecureAccountRoutes />}>
            <Route index element={<Settings token = {token} avatar = {avatar} username = {username} email = {email} setAvatar = {setAvatar}/>} />
            <Route path = "settings" element={<Settings token = {token} avatar = {avatar} username = {username} email = {email} setAvatar = {setAvatar}/>} />
            <Route path = "log-in" element = {<LogIn setToken={setToken} setAvatar={setAvatar} setUsername={setUsername} setEmail={setEmail} token={token}/>}/>
            <Route path = "dashboard" element = {<Dashboard/>}/>
            <Route path = "sign-up" element = {<SignUp setToken={setToken} setAvatar={setAvatar} setUsername={setUsername} setEmail={setEmail}/>}/>
            <Route path="*" element={<NoPage />} />
          </Route>

          <Route path = "games/" element = {<SecureAccountRoutes />}>
            <Route index element={<Navigate to="/account/dashboard" />} />
            <Route path = "BlitzBout" element = {<BlitzBout/>}/>
            <Route path="*" element={<NoPage />} />
          </Route>

          <Route path="*" element={<NoPage />} />

        </Route>
      </Routes>
    </BrowserRouter>
  );
}
